import React from 'react';
import './Snowfall.css'; // Import the CSS file for styling

const Snowfall = () => {
  return (
    <div className="snowfall">
      {[...Array(50)].map((_, index) => (
        <div key={index} className="snowflake" />
      ))}
    </div>
  );
};

export default Snowfall;
